import React, { Component } from 'react';
import Form from './Form';

class App extends Component {
    
    render() {
        return (
            <div>
                <Form
                    addItemToState={this.props.addItemToState}
                    updateState={this.props.updateState}
                    item={this.props.item} />                
            </div>
        )
    }
}
export default App;
